import React, { Component } from 'react';
import './slide.css';
import Slider from "react-slick";
import Teste from "../../images/teste.jpeg"

export default class Slide extends Component {
  render() {
    const settings = {
        dots: true,
        infinite: true,
        fade: true,
        cssEase: 'linear',
        autoplay: true,
        autoplaySpeed: 500,
    };
    return (
      <div className="slider-imagens">
        <Slider {...settings}>
            <img src={"./logo.jpeg"} />
        </Slider>
      </div>
    );
  }
}
